// Generated by Mochi transpiler
List<List<String>> initGrid(int size) {
  List<List<String>> g = [];
  int y = 0;
  while (y < size) {
    List<String> row = [];
    int x = 0;
    while (x < size) {
    row = [...row, " "];
    x = x + 1;
  }
    g = [...g, row];
    y = y + 1;
  }
  return g;
}

void set(List<List<String>> g, int x, int y) {
  if (x >= 0 && x < g[0].length && y >= 0 && y < g.length) {
    g[y]![x] = "#";
  }
}

List<List<String>> circle(int r) {
  final int size = r * 2 + 1;
  List<List<String>> g = initGrid(size);
  int x = r;
  int y = 0;
  int err = 1 - r;
  while (y <= x) {
    set(g, r + x, r + y);
    set(g, r + y, r + x);
    set(g, r - x, r + y);
    set(g, r - y, r + x);
    set(g, r - x, r - y);
    set(g, r - y, r - x);
    set(g, r + x, r - y);
    set(g, r + y, r - x);
    y = y + 1;
    if (err < 0) {
    err = err + 2 * y + 1;
  } else {
    x = x - 1;
    err = err + 2 * (y - x) + 1;
  }
  }
  return g;
}

String trimRight(List<String> row) {
  int end = row.length;
  while (end > 0 && row[end - 1] == " ") {
    end = end - 1;
  }
  String s = "";
  int i = 0;
  while (i < end) {
    s = s + row[i];
    i = i + 1;
  }
  return s;
}

List<List<String>> g = circle(10);
void main() {
  for (var row in g) {
    print(trimRight(row));
  }
}
